import React from "react";
import TodoItem from "../Todo/TodoItem";

const TodoList = ({ props, onRemove }) => {
  return (
    <ul>
      {props.items.map((todo) => (
        <TodoItem
          key={todo.id}
          name={todo.name}
          date={todo.date}
          status={todo.status}
          removeTodoHandler={todo.id}
        />
      ))}
    </ul>
  );
};

export default TodoList;
